Kill/Dil (2014) is an Indian romantic action drama film directed by Shaad Ali and produced by Aditya Chopra under the Yash Raj Films banner. The film stars Ranveer Singh, Ali Zafar and Parineeti Chopra in lead roles, with Govinda portraying the antagonist.The film released on 14 November 2014.


